    false,nt"url": null,nt"notes": "This disk or set of disks contain high-resolution
    multibeam and backscatter maps of an area North of Madison-Swanson (29.1667N, 85.6667W),
    in the West-Florida shelf, not included in a previous mapping expedition to the
    area. It includes the following products: 1) ESRI .ASC files, 2) Text file containing
    X, Y, Z postprocessed bathymetry data, 3) Geotiff and JPEG images from of bathymetry,
    4) GeoTiff and JPEG images of backscatter, and 5) Fledermaus files of the survey
    locations. All products are available contacting the distributor. Some data sets
    are also posted on NOAA's Coral Reef Information System (CoRIS) at www.coris.noaa.gov.
    Another product that will not be distributed, but will be used as input to habitat
    classification software (QTC MultiView), are raw data files logged to disk using
    the Simrad EM3000 multibeam system data acquisition software. These raw files contain
    packets of information (depth soundings, navigation, attitude, sound velocity profiles,
    UTC time) that the acquisition software logged sequentially in time. The raw data
    format is available from Kongsberg-Simrad. The multibeam system was provided by
    University of South Florida, College of Marine Science and the support vessel was
    the Florida Institute of Oceanography R/V Suncoaster.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
